        "text": "Enchanted Airways is an outdoor steel junior roller coaster located in the Far Far Away zone at Universal Studios Singapore. Guests of all ages climb aboard Donkey's beloved Dragon for a flight over Far Far Away and beyond. Throughout the ride, guests will be treated to a cast of fairy tale creatures, from the Three Little Pigs to the Big Bad Wolf, from Gingy to Pinocchio. The entrance to the Enchanted Airways is located of the main street of the Far Far Away land. The queue is located within a medieval-style tent which features a variety of Shrek theming and other Dragon related things of Far Far Away. The queue eventually leads to the load station where guests are sorted into their rows in front of air gates. Riders are seated in a dragon-themed train in pairs with a lap bar restraint. The train is taken up a friction wheel lift hill to a height of 13 metres (43 ft). At the top of this hill, riders can see across Universal Studios Singapore's lagoon and towards other areas of the park. A small drop follows the lift hill that then leads into two downward helices. The train then dips diagonally under the lift hill before elevating and approaching the back end of the station and passing over top. The train then runs back parallel with the lift hill before entering two separate helices and entering the brake run. Throughout several times the train passes themed elements including Shrek's Swamp, a forest and Medieval areas. The exit path leads riders back to the Far Far Away plaza.",
